import React from 'react';
import {Modal, ModalBody, ModalHeader, ModalFooter, Button, Fl} from 'reactstrap';

class Login extends React.Component {

    constructor(props){
        super(props);
        this.state = {
            isOpen: true
        };
    }

    hideModal = () => {
        this.setState({isOpen: false})
    };

    render() {
        const Flexbox_centered = {
            display: 'flex',
            justifyContent: 'center'
        };
        return (
            <Modal id="login" isOpen={this.state.isOpen} centered>
                <Flexbox_centered className={Flexbox_centered}>
                    <h5 className="modal-title">Введите свой никнейм</h5>
                </Flexbox_centered>
                <ModalBody>
                    <input />
                </ModalBody>
                <ModalFooter>
                    <Button onClick={this.hideModal}>ОК</Button>
                </ModalFooter>
            </Modal>
        );
    }
}

export default Login;
